description:
Das BiotopVerbund-Projekt „Landschaft + Menschen verbinden – Kommunen für den bundesweiten Biotopverbund“, im Bundesprogramm Biologische Vielfalt, veranstaltet am 30.07.2024 von 16:00-17:00 Uhr ein Webinar zum Thema „Kleingewässer: wichtige Elemente im Biotopverbund und zur Förderung der biologischen Vielfalt“.
Dieses Webinar richtet sich direkt an Vertreterinnen und Vertreter von Kommunen und vermittelt praktische Tipps zur effektiven Renaturierung, Neuanlage und nachhaltigen Pflege von Kleingewässern. Weitere Informationen zur Veranstaltung und zur Anmeldung zum Webinar finden Sie unter folgendem Link: https://join.next.edudip.com/de/webinar/kleingewasser-wichtige-elemente-im-biotopverbund-und-zur-forderung-der-biologischen-vielfalt/2044305
&nbsp;
